    def set_MW(self):
        self.MW = cmath.sqrt(16*self.mV**2 + 16*self.MWt**2 + 16*self.cvvhh*self.gst**2*self.vv**2 - cmath.sqrt((-16*self.mV**2 - 16*self.MWt**2 - 16*self.cvvhh*self.gst**2*self.vv**2)**2 - 64*(16*self.mV**2*self.MWt**2 + 16*self.cvvhh*self.gst**2*self.MWt**2*self.vv**2 - self.ch**2*self.gst**2*self.gw**2*self.vv**4)))/(4.*cmath.sqrt(2))


